import React from 'react'

export const TodoItem = () => {
  let items = [
    {
      sno: 1,
      title: "Go to Market",
      desc: "Job 1"
    },
    {
      sno: 2,
      title: "Go to Mall",
      desc: "Job 2"
    },
    {
      sno: 3,
      title: "Go to Ghat",
      desc: "Job 3"
    }
  ]

  return (
    <div>
      <h1>{items[0].title} </h1>
      <p> {items[0].desc} </p>
    </div>

  )
}
